	add("witan", "{\"term\":\"witan\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|witan}}, plural of {{m|ang|wita||wise man}}, or more literally \u0026quot;men of wit\u0026quot;, \u0026quot;wits\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Anglo-Saxon national council or witenagemot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1833\u0027\u0027, But in estimating the powers of the \u0027\u0027witan\u0027\u0027, we must not lose sight of the fact, that the king sometimes assumes a tone of superiority scarcely consistent with its independence. — SA Dunham, \u0027Europe in the Middle Ages\u0027 (Green \u0026amp; Longman, p.48\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The members of such an assembly\", \"priority\":3}]}, \"synonyms\":{}}");

	add("witblits", "{\"term\":\"witblits\", \"etymology\":{\"influencers\":[], \"languages\":[\"Afrikaans\", \"English\"], \"text\":\"Afrikaans \u0027wit\u0027 (“white”) + \u0027blits\u0027 (“lightning”).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Home-distilled brandy or raw spirit, colourless and with a powerful kick\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Witblits\u0027\u0027 is made by heating dry wine to 80 degrees celsius. The steam containing the alcohol is cooled and then vapours down to a crystal clear \u0027\u0027witblits\u0027\u0027. http://www.kangowines.com/witblits.htm - 8k\", \"priority\":2}]}, \"synonyms\":{}}");

