	add("witchweed", "{\"term\":\"witchweed\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|witch|weed|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several flowering plants of the genus \u0027Striga\u0027, from Africa and Asia, some of which are parasitic to crops\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, (U.S.) National Research Council: Committee on Plant and Animal Pests: Subcommittee on Weeds, \u0027Principles of Plant and Animal Pest Control\u0027, Volume 2: \u0027Weed Control\u0027, National Academy of Sciences Publication 1597, [http://books.google.com.au/books?id\u003d7GkrAAAAYAAJ\u0026amp;pg\u003dPA43\u0026amp;dq\u003d%22witchweed%22%7C%22witchweeds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dpNqbU9mlJ4jukQXfq4HACQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22witchweed%22%7C%22witchweeds%22\u0026amp;f\u003dfalse page 43\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027witchweed\u0027\u0027-suppression program is a classic example of a systems approach to weed management and represents one of the finest organized efforts in the United States to eradicate a weed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, George Agrios, \u0027Plant Pathology\u0027, [http://books.google.com.au/books?id\u003dxLdSrKhThNEC\u0026amp;pg\u003dPA385\u0026amp;dq\u003d%22witchweed%22%7C%22witchweeds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dpNqbU9mlJ4jukQXfq4HACQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22witchweed%22%7C%22witchweeds%22\u0026amp;f\u003dfalse page 385\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A number of \u0027\u0027witchweed\u0027\u0027 species parasitize important economic plants such as corn, sugarcane, rice, tobacco, and some small grains\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Robert E. Eplee, \u0027Case Study 2.10 Co-ordination of \u0027\u0027Witchweed\u0027\u0027 Eradication in the USA\u0027, Rüdiger Wittenberg, Matthew J. W. Cock (editors), \u0027Invasive Alien Species: A Toolkit of Best Prevention and Management Practices\u0027, [http://books.google.com.au/books?id\u003deZ41ZOX-tH8C\u0026amp;pg\u003dSA2-PA10\u0026amp;dq\u003d%22witchweed%22%7C%22witchweeds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dpNqbU9mlJ4jukQXfq4HACQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22witchweed%22%7C%22witchweeds%22\u0026amp;f\u003dfalse page 36\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The Asian and African \u0027\u0027witchweed\u0027\u0027 (\u0027Striga asiatica\u0027) grows parasitically on the roots of members of the Poaceae, especially maize and sorghum causing significant crop losses, but also on rice, millet, sugar cane and grasses\", \"priority\":10}]}, \"synonyms\":{}}");

	add("witcraft", "{\"term\":\"witcraft\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|wit|craft|lang\u003den}}. 1573 by Ralph Lever, \u0027The Arte of Reason, rightly termed, Witcraft, teaching a perfect way to argue and dispute\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Art or skill of the mind; mental skill; contrivance; invention; the art of wit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Michael Billig, \u0027Arguing and thinking: a rhetorical approach to social psychology\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In its pure form, \u0027\u0027witcraft\u0027\u0027 can be seen as a democratic art. because it does not depend upon technical expertise. Within an ideal context of pure \u0027\u0027witcraft\u0027\u0027, the powerful and the powerless meet upon equal terms\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The art of reasoning; logic\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It argues that a rhetorical approach maintains space for agency on the behalf of employees (through the \u0027\u0027witcraft\u0027\u0027 of argument) ...\u0027 \u0026amp;mdash; Gillian Symon, \u0027Developing the Political Perspective on Technological Change Through Rhetorical Analysis\u0027, Management Communication Quarterly, Vol. 22, No. 1., 2008\", \"priority\":5}]}, \"synonyms\":{}}");

	add("witenagemot", "{\"term\":\"witenagemot\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) {{m|ang|witena ġemōt}}, literally \u0026quot;assembly of the wise\u0026quot;. See {{m|en|gemote}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several assemblies which existed in Anglo-Saxon England from the 7th to the 11th century, initially with regional jurisdiction (there being different ones in Essex, Kent, Mercia, Northumbria, Sussex and Wessex), later with national jurisdiction, made up of important noblemen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A specific session of such an assembly\", \"priority\":2}]}, \"synonyms\":{}}");

	add("withe", "{\"term\":\"withe\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"Latin\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027withe\u0027 \u0027withthe\u0027 from Old english (ca. 450-1100) \u0027wiþe\u0027 \u0027wiþþe\u0027 (cord, band, thong, fetter) from Proto-germanic {{m|gem-pro|*wiþiz}}, {{m|gem-pro|*wiþjǭ||cord, rope}}, from Proto-indo-european {{m|ine-pro|*weyt-||that which winds or bends, branch, switch}}, from Proto-indo-european {{m|ine-pro|*wey-||to turn, wind, bend}}. Cognate with Danish \u0027vidje\u0027 (wicker) Swedish \u0027vidja\u0027 (withe, wicker, osier) Icelandic \u0027við\u0027 \u0027viðja\u0027 (a withe) Latin \u0027vītis\u0027 (vine)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flexible, slender twig or shoot, especially when used as a band or for binding; a withy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027: Perhaps indifferent to their social Rejection, he sets to work separating his Tree into Poles, Sticks, and \u0027\u0027Withes\u0027\u0027, and placing them wherever in the Structures of Dam or Lodge he feels they need to go. — Thomas Pynchon, \u0027Mason \u0026amp; Dixon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An iron attachment on one end of a mast or boom, with a ring, through which another mast or boom is rigged out and secured\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A partition between flues in a chimney\", \"priority\":4}]}, \"synonyms\":{}}");

	add("withers", "{\"term\":\"withers\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\"], \"text\":\"1580, from Old english (ca. 450-1100) dialectal \u0027wiðer\u0027 (against) {{suffix||s|lang\u003den}}; see \u0027with\u0027 So-named because the part of the horse that pushes \u0027against\u0027 a load. Compare German \u0027widerrist\u0027 (withers) from \u0027wider\u0027 (against) + \u0027rist\u0027 (wrist) \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of the back of a four-legged animal that is between the shoulder blades; in many species the highest point of the body and the standard place to measure the animal\u0027s height\", \"priority\":1}]}, \"synonyms\":{}}");

	add("witness", "{\"term\":\"witness\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"old high german (ca. 750-1050)\"], \"text\":\"{{PIE root|en|weyd}}From Middle english (1100-1500) \u0027witnesse\u0027 from Old english (ca. 450-1100) \u0027witnes\u0027 (knowledge, witness, testimony, a witness) equivalent to {{suffix|wit|ness|lang\u003den}}. Cognate with Middle dutch (ca. 1050-1350) \u0027wetenisse\u0027 (witness, testimony) Old high german (ca. 750-1050) \u0027gewiznessi\u0027 (testimony)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Attestation of a fact or event; testimony\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She can bear \u0027\u0027witness\u0027\u0027, since she was there at the time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"May we with the \u0027\u0027witness\u0027\u0027 of a good conscience, pursue him with any further revenge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who sees or has personal knowledge of something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As a \u0027\u0027witness\u0027\u0027 to the event, I can confirm that he really said that\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thyself art \u0027\u0027witness\u0027\u0027 I am betrothed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Upon my looking round, I was \u0027\u0027witness\u0027\u0027 to appearances which filled me with melancholy and regret\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Someone called to give evidence in a court\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027witness\u0027\u0027 for the prosecution did not seem very credible\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Something that serves as evidence; a sign\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Bible, Genesis xxxi. 51, 5\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Laban said to Jacob, This heap be \u0027\u0027witness\u0027\u0027, and this pillar be \u0027\u0027witness\", \"priority\":12}]}, \"synonyms\":{}}");

	add("witticism", "{\"term\":\"witticism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|witty|icism|lang\u003den}}; coined in the 1670s by {{w|John Dryden}}, by analogy to {{m|en|criticism}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a witty remar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883:\u0027\u0027 w:George George Eliot, \u0027The Essays of George Elliot\u0027, chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shock of the \u0027\u0027witticism\u0027\u0027 is a powerful one; while mere fun will have no power over them if it jar on their moral taste\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2015:\u0027\u0027 Hans Rollman, \u0027Freedom of Speech: It’s Complicated\u0027, PopMatter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"While the occasional wry \u0027\u0027witticism\u0027\u0027 seeps through, overall Shipler is painfully conscientious about trying to offer both sides of any debate\", \"priority\":5}]}, \"synonyms\":{}}");

