	add("wittol", "{\"term\":\"wittol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027witewold\u0027 () likely a blend of \u0027witen\u0027 (lang\u003denm) + \u0027cockewold\u0027 (lang\u003denm) equivalent to {{compound|wit|cuckold|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who knows, condones and even encourages his wife\u0027s enjoyment of coitus with another man or men; a contented cuckold\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"New York Review of Books 2001, p.67\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To seea \u0027\u0027wittol\u0027\u0027 wink at his wife\u0027s honesty, and too perspicuous in all other affairs\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, Sir , \u0027w:One Thousand and One The Book of the Thousand Nights and a Night\u0027, \u0026quot;Night 13\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"So the Ifrit cried at her, \u0026quot;Thou whorest and makest me a \u0027\u0027wittol\u0027\u0027 with thine eyes;\u0026quot; and struck her so that her head went flying\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"God help the husband that obliges his wife\u0027s least whim: he\u0027ll be a \u0027\u0027wittol\u0027\u0027 ere he\u0027s two years wed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A bird, the wheatear\", \"priority\":7}]}, \"synonyms\":{}}");

	add("witwanton", "{\"term\":\"witwanton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|wit|wanton|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who indulges in idle, foolish, and irreverent fancies or speculations; one who tries to be cleverly amusing but falls short\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1613\u0027\u0027, Josuah Sylvester, \u0027Lachrymae Lachrymarum\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All epicures, \u0027\u0027witwantons\u0027\u0027, atheists\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, David Grambs, \u0027Dimboxes, epopts, and other quidams\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027witwanton\u0027\u0027 is always a little off in trying to be always GETTING MENTAL\", \"priority\":5}]}, \"synonyms\":{}}");

